import React from 'react'
import styled from 'styled-components'

const RecipeStyled = styled.div`
    background-color: yellow;

    img {
        display: inline;
        width: 100px;
    }
`;

const Recipe = () => {

    const imgUrl = 'https://images.unsplash.com/photo-1512621776951-a57141f2eefd?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80'

    return (
        <div>
            <img src={imgUrl} alt="Plate" />
            <div>
                <h3>Kind a long title for a plate of healthy food</h3>
                <p>Categorie: Grandma Super Special</p>
            </div>
        </div>
    )
}

export default Recipe
